import{_ as e,o as a,c as i,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-5900 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5900.md","filePath":"vacode/3.2-5900.md"}'),t={name:"vacode/3.2-5900.md"},n=r('<h1 id="§-3-2-5900-definitions" tabindex="-1">§ 3.2-5900 Definitions. <a class="header-anchor" href="#§-3-2-5900-definitions" aria-label="Permalink to &quot;§ 3.2-5900 Definitions.&quot;">​</a></h1><p>As used in this subtitle, unless the context requires a different meaning:</p><p>&quot;Accredited veterinarian&quot; means a veterinarian approved by the Administrator of the U.S. Department of Agriculture in accordance with 9 C.F.R. Part 161, which includes the authority to issue health certificates.</p><p>&quot;Animal&quot; means any organism of the kingdom Animalia, other than a human being.</p><p>&quot;Hatching egg&quot; means any egg of any chicken, turkey, waterfowl, or game bird, or the egg of any other avian species that is used or intended to be used for hatching purposes.</p><p>&quot;Horse&quot; means any stallion, colt, gelding, mare, or filly.</p><p>&quot;Livestock&quot; includes all domestic or domesticated bovine animals; equine animals; ovine animals; porcine animals; cervidae animals; capradae animals; animals of the genus Lama or Vicugna; ratites; fish or shellfish in aquaculture facilities, as defined in § <a href="/vacode/3.2-2600/">3.2-2600</a>; enclosed rabbits or hares raised for human food or fiber; or any other individual animal specifically raised for food or fiber, except companion animals.</p><p>&quot;Passport&quot; means a document that may be used in lieu of a Certificate of Veterinary Inspection and shall contain animal identifiers and health maintenance history such as vaccinations and laboratory tests.</p><p>&quot;Poultry&quot; includes all domestic fowl and game birds raised in captivity.</p><p>&quot;State Veterinarian&quot; means the veterinarian employed by the Commissioner as provided in § <a href="/vacode/3.2-5901/">3.2-5901</a>.</p><p>&quot;State Veterinarian&#39;s representative&quot; means any person who is either: (i) an employee of the Department under the direction of the State Veterinarian; or (ii) a veterinarian deputized pursuant to § <a href="/vacode/3.2-5901/">3.2-5901</a>.</p><p>Code 1950, §§ 3-4, 3-13; 1966, c. 702, §§ 3.1-4, 3.1-14; 1972, c. 531; 1975, c. 260; 1977, c. 186; 1978, cc. 219, 540; 1982, c. 150; 1984, c. 492, § 29-213.36; 1987, c. 488, § 3.1-796.66; 1988, c. 538; 1991, c. 348; 1993, cc. 174, 455, 959; 1994, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0261" target="_blank" rel="noreferrer">261</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0370" target="_blank" rel="noreferrer">370</a>; 1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0010" target="_blank" rel="noreferrer">10</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0610" target="_blank" rel="noreferrer">610</a>; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0996" target="_blank" rel="noreferrer">996</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0817" target="_blank" rel="noreferrer">817</a>; 2002, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0351" target="_blank" rel="noreferrer">351</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0500" target="_blank" rel="noreferrer">500</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0787" target="_blank" rel="noreferrer">787</a>; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0544" target="_blank" rel="noreferrer">544</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0551" target="_blank" rel="noreferrer">551</a>, § 3.1-741.3; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1007" target="_blank" rel="noreferrer">1007</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0633" target="_blank" rel="noreferrer">633</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0258" target="_blank" rel="noreferrer">258</a>.</p>',12),o=[n];function l(s,c,g,f,h,p){return a(),i("div",null,o)}const v=e(t,[["render",l]]);export{u as __pageData,v as default};
